import React from 'react';
import './App.css';
import { Box, Paper, Typography, TextField, Button, Container} from '@mui/material';

function App() {
  return (
    <Container sx={{
      width: "100%",
      display: "flex",
      alignItems: "center",
      alignContent: "center"
    }}>
      <Box sx={{
        width: "200px"
      }}>
        <Paper>
          <Typography>Hi</Typography>
        </Paper>
        <Box>
          <TextField />
          <Button>Sent</Button>
        </Box>

      </Box>
    </Container>
  );
}

export default App;
